import {Outlet, Link} from 'react-router-dom'; 
import Button from 'react-bootstrap/Button';

export default function () {
    return (
        <div>
            <header>
                <Link to="buy">
                    <Button> Buy </Button>
                </Link>
                <Link to="sell"> 
                    <Button> Sell </Button>
                </Link>                
            </header>
            <div>
                <Outlet />
            </div>
        </div>
    )
}
